        public int[] SmallerNumbersThanCurrent(int[] nums)
        {
            int[] ret = new int[nums.Count()];
            Dictionary<int, int> dic = new Dictionary<int, int>();
            var sortNums = (int[])nums.Clone();
            Array.Sort(sortNums);
            for (int i = 0; i < sortNums.Count(); i++)
            {
                if(i==0)
                {
                    dic[sortNums[i]] = i;
                }
                else if (sortNums[i] > sortNums[i - 1])
                {                    
                    dic[sortNums[i]] = i;
                }
            }
            for (int i = 0; i < nums.Count(); i++)
            {
                ret[i] = dic[nums[i]];
            }

            return ret;
        }

        public int[] TwoSum(int[] nums, int target)
        {
            //Dictionary is used to store data
            Dictionary<int, int> dict = new Dictionary<int, int>();
            for (int i = 0; i < nums.Length; i++)
            {
                if (dict.ContainsKey(target - nums[i]))
                    return new int[] { dict[target - nums[i]], i };
                else
                    dict[nums[i]] = i;
            }

            return new int[0];
        }

        public int SubtractProductAndSum(int n)
        {
            if (n == 0) return 0;
            int productOfDigits = 1;
            int sumOfDigits = 0;
            while (n != 0)
            {
                var i = n % 10;
                productOfDigits = productOfDigits * i;
                sumOfDigits = sumOfDigits + i;
                n = Convert.ToInt16(Math.Floor(n / 10.00));
            }
            return productOfDigits - sumOfDigits;
        }

        public int NumJewelsInStones(string J, string S)
        {
            //use count funciton
            int count = 0;

            for (int i = 0; i < J.Length; i++)
            {
                count += S.Count(e => e == J[i]);
            }

            return count;
        }

        public int[] GetNoZeroIntegers(int n)
        {
            // loop through each digit of Integer
            for (int i = 1; i < n; i++)
            {
                var s = i.ToString();
                if (s.Contains('0')) continue;
                else s = (n - i).ToString();

                if (s.Contains('0')) continue;
                else return new int[2] { i, n - i };
            }
            return new int[0];

        }

        public int MinFlips(int a, int b, int c)
        {
            //loop through each bit of binary
            int count = 0;
            while (((a | b) ^ c) != 0)
            {
                var sa = a & 1;
                var sb = b & 1;
                var sc = c & 1;
                if (((sa | sb) ^ sc) != 0)
                {
                    if (sa == 1 && sb == 1) count += 2;
                    else count += 1;
                }

                a = a >> 1;
                b = b >> 1;
                c = c >> 1;
            }
            return count;

        }

        public int BalancedStringSplit(string s)
        {
            // using condition operation 
            int cout = 0;
            int ret = 0;
            for (int i = 0; i < s.Length; i++)
            {

                cout += s[i] == 'L' ? 1 : -1;

                if (cout == 0) ret += 1;

