        public int BalancedStringSplit_Queuen(string s)
        {
            Queue<char> que = new Queue<char>();
            int ret = 0;
            for (int i = 0; i < s.Length; i++)
            {

                if (que.Count() == 0 || s[i] == que.First())
                {
                    que.Enqueue(s[i]);
                }
                else
                {
                    que.Dequeue();
                }

                if (que.Count() == 0) ret += 1;

            }
            return ret;
        }
        public int BalancedStringSplit_tuple(string s)
        {
            Tuple<char, int> arr = new Tuple<char, int>(' ', 0);
            int ret = 0;
            for (int i = 0; i < s.Length; i++)
            {
                if (arr.Item1 == ' ')
                {
                    arr = Tuple.Create(s[i], arr.Item2 + 1);
                }
                else
                {
                    if (s[i] == s[i - 1] && s[i] == arr.Item1)
                    {
                        arr = Tuple.Create(arr.Item1, arr.Item2 + 1);
                    }
                    else
                    {
                        if (s[i] == arr.Item1)
                        {
                            ret += 1;
                            arr = new Tuple<char, int>(' ', 0);
                        }
                        else
                        {
                            arr = Tuple.Create(arr.Item1, arr.Item2 - 1);
                            if (arr.Item2 == 0)
                            {
                                ret += 1;
                                arr = new Tuple<char, int>(' ', 0);
                            }
                        }

                    }
                }
            }
            return ret;
        }

        public int[] DecompressRLElist(int[] nums)
        {

            Queue<int> snums = new Queue<int>();
            int count = 0;
            for (int i = 0; i < nums.Count(); i++)
            {
                if (i % 2 == 0) count = nums[i];
                else
                {
                    for (int j = 0; j < count; j++)
                    {
                        snums.Enqueue(nums[i]);
                    }

                }
            }

            return snums.ToArray();
        }

        public int? FindDifferency(int[] arr1, int[] arr2)
        {
            HashSet<int> dict = new HashSet<int>();
            foreach (int i in arr2)
            {
                dict.Add(i);
            }

            foreach (int i in arr1)
            {
                if (dict.Contains(i) == false)
                {
                    return i;
                }
            }

            return null;
        }

        public int RangeSumBST(TreeNode<int> root, int L, int R)
        {
            int ret = 0;
            if (root == null) return 0;
            if (L <= root.val && root.val <= R)
                ret = ret + root.val;
            return ret + RangeSumBST(root.left, L, R) + RangeSumBST(root.right, L, R);
        }

        public int RangeSumBST1(TreeNode<int> root, int L, int R)
        {
            Stack<TreeNode<int>> subRoot = new Stack<TreeNode<int>>();
            TreeNode<int> current = null;
            int ret = 0;
            subRoot.Push(root);
            while (subRoot.Count() > 0)
            {
                current = subRoot.Pop();
                if (current != null)
                {
                    if (L <= current.val && current.val <= R)
                    {
                        ret += current.val;

                    }
                    subRoot.Push(current.right);
                    subRoot.Push(current.left);
                }

            }
            return ret;
        }

        public int MinTimeToVisitAllPoints(int[][] points)
        {
            int ret = 0;
            for (int i = 1; i < points.Length; i++)
            {
                ret += Math.Max(Math.Abs(points[i][0] - points[i - 1][0]), Math.Abs(points[i][1] - points[i - 1][1]));
            }
            return ret;
        }

        public int OddCells(int n, int m, int[][] indices)
        {
            Dictionary<int, int> dicn = new Dictionary<int, int>();
            Dictionary<int, int> dicm = new Dictionary<int, int>();

            for (int i = 0; i < indices.Length; i++)
            {
                if (dicn.ContainsKey(indices[i][0]))
                {
                    dicn[indices[i][0]] += 1;
                }
                else
                {
                    dicn[indices[i][0]] = 1;
                }

                if (dicm.ContainsKey(indices[i][1]))
                {
                    dicm[indices[i][1]] += 1;
                }
                else
                {
                    dicm[indices[i][1]] = 1;
                }

            }

            int nodd = 0;
            int neven = 0;
            foreach (var j in dicn)
            {
                if (j.Value % 2 == 0)
                    neven += 1;
                else nodd += 1;
            }
            int modd = 0;
            int meven = 0;
            foreach (var j in dicm)
            {
                if (j.Value % 2 == 0)
                    meven += 1;
                else modd += 1;
            }

            return ((nodd * m - nodd * modd) + (modd * n - nodd * modd));
        }

        public int[] SumZero(int n)
        {
            int[] rtype = new int[n];
            int ptotal = 1;
            int indice = 0;
            while (indice < Math.Floor(Convert.ToDecimal(n / 2)))
            {
                rtype[indice] = ++indice;
                //ptotal = (2 * ptotal) + 1;
            }
            if (n % 2 != 0) rtype[indice++] = 0;
            ptotal = 0;
            while (n - indice > 0)
            {
                rtype[indice++] = --ptotal;
            }
            return rtype;
        }

