            for (int i = 0; i < length; i++)
            {
                List<char> stack = new List<char>();
                foreach (var j in sArray)
                {

                    if (i < j.Length)
                    {
                        stack.Add(j[i]);
                    }
                    else
                    {
                        stack.Add(' ');
                    }
                }
