        public IList<int> SortArray(int[] nums)
        {
            if (nums.Count() == 1) return nums;
            var pivot = Math.Floor(Convert.ToDecimal(nums.Count()/2));
            var lefts = SortArray(nums.Take(Convert.ToInt16(pivot)).ToArray());
            var rights = SortArray(nums.TakeLast(Convert.ToInt16(nums.Count() - pivot)).ToArray());
            return MergeSort(lefts.ToArray(), rights.ToArray());
        }
        public IList<int> MergeSort(int[] lefts, int[] rights)
        {
            IList<int> ret = new List<int>();
            int i = 0;
            int j = 0;
            while (i < lefts.Count() && j < rights.Count())
            {

                if (lefts[i] > rights[j])
                {
                    ret.Add(rights[j++]);
                }
                else ret.Add(lefts[i++]);

            }

            if (i < lefts.Count())
            {
                for(;i<lefts.Count();i++) ret.Add(lefts[i]);
            }

            if (j < rights.Count())
            {
                for (; j < rights.Count(); j++) ret.Add(rights[j]);
            }
            return ret;
        }



