        public int[] Swap(int[] lefts, int[] rights)
        {
            List<int> ret = new List<int>();
            int left = 0;
            int right = 0;
            while ((left < lefts.Count() && right < rights.Count()) && (lefts[left] % 2 == 0 || rights[right] % 2 == 0))
            {
                if (lefts[left] % 2 == 0)
                {
                    ret.Add(lefts[left++]);
                }
                if (rights[right] % 2 == 0)
                {
                    ret.Add(rights[right++]);
                }

            }

            if (left < lefts.Count())
            {
                for (; left < lefts.Count(); left++) ret.Add(lefts[left]);
            }
            if (right < rights.Count())
            {
                for (; right < rights.Count(); right++) ret.Add(rights[right]);
            }
            return ret.ToArray();
        }

        public int MySqrt(int x)
        {

            int l = 1;
            int h = x;
            while (l <= h)
            {
                var m = l + (h - l) / 2;
                var sqr = x / m;
                if (sqr < m)
                {
                    h = m - 1;
                }
                else if (sqr == m) return m;
                else
                {
                    l = m + 1;
                }
            }

            return h;
        }

        public int RemovePalindromeSub(string s)
        {
            if (s.Length == 0) return 0;
            int first = 0;
            int last = s.Length - 1;
            int ret = 1;
            while (first <= last)
            {
                if (s[first] != s[last]) return 2;
                first += 1;
                last -= 1;
            }
            return ret;

            //return 2 - (s == string(s.rbegin(), s.rend())) - s.empty();
        }

        public char NextGreatestLetter(char[] letters, char target)
        {
            int first = 0;
            int last = letters.Count();
            int m = first + (last - first) / 2;
            while (first < last)
            {
                m = first + (last - first) / 2;
                if (letters[m] <= target)
                {
                    first = m + 1;
                }
                else last = m;
            }

            return (first < letters.Count()?letters[first]:letters[0]);
        }

        public int SingleNonDuplicate(int[] nums)
        {
            int first = 0;
            int last = nums.Count() - 1;


            while (first < last)
            {
                var m = first + (last - first) / 2;
                if (m % 2 == 1) m -= 1;
                if (nums[m] == nums[m + 1]) first = m + 2;
                else
                    last = m;

            }
            return nums[first];
        }

        public int FindMin(int[] nums)
        {
            int first = 0;
            int last = nums.Count()-1;
            int m = 0;
            while (first < last)
            {
                //Console.WriteLine(first);
                //Console.WriteLine(m);
                //Console.WriteLine(last);
                m = first + (last - first) / 2;
                if (nums[m] >= nums[0] && nums[m] > nums[nums.Count() - 1])
                {
                    first = m + 1;
                }
                else if (nums[m] > nums[0] && nums[m] < nums[nums.Count() - 1]) last = m;
                else if (nums[m] <= nums[0] && nums[m] < nums[nums.Count() - 1]) last = m;
                //else first = m + 1;

            }

            return nums[first];
        }

        public int[] SearchRange(int[] nums, int target)
        {
           
            int[] ret = new int[] { -1, -1 };
            if (nums.Count() == 0) return ret;
            int first = 0;
            int last = nums.Count() - 1;
            int m = 0;
            while (first < last)
            {

                m = first + (last - first) / 2;
                //Console.WriteLine(first);
                if (nums[m] < target)
                {
                    first = m + 1;
                }
                else last = m;
            }

            if (nums[first] != target) return ret;
            ret[0] = first;
            last = nums.Count() - 1;
            while (first < last)
            {
                m = first + (last - first) / 2;
                Console.WriteLine(m);
                if (nums[m] > target)
                {
                    last = m;
                }
                else
                {
                    if (nums[m] != nums[m + 1])
                    { first = m; break; }
                    first = m + 1;
                }
            }

            ret[1] = first;
            return ret;
        }


        public int[] KWeakestRows(int[][] mat, int k)
        {
            SortedDictionary<int, Queue<int>> dic = new SortedDictionary<int, Queue<int>>();

            for (int i = 0; i < mat.Count(); i++)
            {
                var temp = mat[i].Count(e => e == 1);
                if (!dic.ContainsKey(temp))                
                    dic[temp] = new Queue<int>();
                   
                dic[temp].Enqueue(i);

            }
            int[] ret = new int[k];
            foreach (var i in dic)
            {

                while (i.Value.Count() > 0)
                {
                    ret[ret.Count() - k] = i.Value.Dequeue();
                    k -= 1;
                    if (k<1) return ret;
                }
            }

            return ret;

        }


        public IList<int> LuckyNumbers(int[][] matrix)
        {
            List<int> ret = new List<int>();
            var a = matrix.ToList();
            var c = a.Select(e => e.Min()).ToList();
            
            for(int i=0;i<c.Count();i++)
            {
                var ind = Array.IndexOf(matrix[i],c[i]);
                
                var b = a.Max(e => e[ind]);
                if (b == c[i])
                    ret.Add(b);
            }

            //ret.RemoveAt(0);
            
            return ret;
        }
